import {useEffect} from 'react'
import { useNavigate } from 'react-router';

export default function ProtectedRoute(props) {
    const {Component} = props;
    const navigate = useNavigate();
    useEffect(()=>{
        let login = localStorage.getItem('login');
        if(!login){
            navigate("/login")
        }
    })
  return (
    <div><Component/></div>
  )
}
